        // Perform the search
      };
      
  return (
    <div>
      <FormControl
      type="text"
      placeholder="Search..."
      value={query}
      onChange={(e) => setQuery(e.target.value)}
    />
    <Button variant="primary" onClick={handleSearch}>Search</Button>
    </div>
  )
}

export default Project
